/*Table structure for table `citys` */

DROP TABLE IF EXISTS `citys`;

CREATE TABLE `citys` (
  `id` int(10) NOT NULL auto_increment COMMENT '城市id',
  `cityid` varchar(20) default NULL COMMENT '城市编号',
  `city` varchar(20) default NULL COMMENT '城市名称',
  `city_py` varchar(200) default NULL COMMENT '城市名称全拼',
  `city_pym` varchar(20) default NULL COMMENT '城市名称首字母',
  `clazz` int(1) default NULL COMMENT '城市行政级别',
  `parent_id` int(11) default NULL COMMENT '上一级id',
  `postcode` varchar(10) default NULL COMMENT '邮编',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

