/*Table structure for table `commodity` */

DROP TABLE IF EXISTS `commodity`;

CREATE TABLE `commodity` (
  `id` int(10) NOT NULL auto_increment COMMENT '商品id',
  `commodity_no` varchar(20) NOT NULL COMMENT '名称',
  `name` varchar(50) default NULL COMMENT '总类名',
  `category_id` int(11) default NULL,
  `introduce` varchar(200) default NULL COMMENT '介绍',
  `detailed` varchar(5000) default NULL COMMENT '商品详细信息',
  `pictureurl` varchar(200) default NULL COMMENT '商品图片',
  `createtime` datetime default NULL COMMENT '创建时间',
  `updatetime` datetime default NULL COMMENT '修改时间',
  `states` int(1) default '0' COMMENT '0',
  PRIMARY KEY  (`id`),
  KEY `categorycommodity_idx` (`category_id`),
  KEY `commodityno_idx` (`commodity_no`),
  CONSTRAINT `category_commodity` FOREIGN KEY (`category_id`) REFERENCES `category` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

