/*Table structure for table `commodity_browse_statistics` */

DROP TABLE IF EXISTS `commodity_browse_statistics`;

CREATE TABLE `commodity_browse_statistics` (
  `id` int(10) NOT NULL auto_increment COMMENT '统计id',
  `commodity_no` varchar(20) default NULL COMMENT '商品编号',
  `count` int(10) default '0' COMMENT '浏览次数',
  `type` int(1) default '1' COMMENT '类型，分为一月，三月，6月，12月四挡，分别对应1,2,3,4',
  PRIMARY KEY  (`id`),
  KEY `commodity_cstatistics` (`commodity_no`),
  CONSTRAINT `commodity_cstatistics` FOREIGN KEY (`commodity_no`) REFERENCES `commodity` (`commodity_no`)
