/*Table structure for table `commodity_store` */

DROP TABLE IF EXISTS `commodity_store`;

CREATE TABLE `commodity_store` (
  `id` int(10) NOT NULL auto_increment COMMENT '商品价格id',
  `store_no` varchar(20) default NULL COMMENT '门店id',
  `commodity_no` varchar(20) default NULL COMMENT '商品编号',
  `commodity_price` decimal(10,2) default '0.00' COMMENT '商品价格',
  `real_price` decimal(10,2) default '0.00' COMMENT '商品实际售价',
  `commodity_amont` int(11) default '0' COMMENT '商品库存',
  `commodity_lockamont` int(11) default '0' COMMENT '商品锁库存',
  `type` int(1) default '0' COMMENT '0',
  PRIMARY KEY  (`id`),
  KEY `commodity_commoditystore_idx` (`commodity_no`),
  KEY `store_commoditystore_idx` (`store_no`),
  CONSTRAINT `commodity_commoditystore` FOREIGN KEY (`commodity_no`) REFERENCES `commodity` (`commodity_no`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `store_commoditystore` FOREIGN KEY (`store_no`) REFERENCES `store` (`store_no`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

