/*Table structure for table `log` */

DROP TABLE IF EXISTS `log`;

CREATE TABLE `log` (
  `id` int(10) NOT NULL auto_increment COMMENT '日志id',
  `manager_id` int(10) default NULL COMMENT 'id',
  `ip` varchar(20) default NULL COMMENT '操作ip',
  `url` varchar(200) default NULL COMMENT '网址',
  `content` varchar(200) default NULL COMMENT '操作内容',
  `createtime` datetime default NULL COMMENT '创建时间',
  PRIMARY KEY  (`id`),
  KEY `manager_log_idx` (`manager_id`),
  CONSTRAINT `manager_log` FOREIGN KEY (`manager_id`) REFERENCES `manager` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

