/*Table structure for table `orderitem` */

DROP TABLE IF EXISTS `orderitem`;

CREATE TABLE `orderitem` (
  `id` int(11) NOT NULL auto_increment,
  `order_id` int(11) default NULL,
  `commodity_no` varchar(20) default NULL,
  `amount` int(11) default NULL,
  `listprice` double default NULL,
  `totalprice` double default NULL,
  PRIMARY KEY  (`id`),
  KEY `orders_orderitem_idx` (`order_id`),
  KEY `commodity_orderitem_idx` (`commodity_no`),
  CONSTRAINT `commodity_orderitem` FOREIGN KEY (`commodity_no`) REFERENCES `commodity` (`commodity_no`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `orders_orderitem` FOREIGN KEY (`order_id`) REFERENCES `orders` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
