/*Table structure for table `orders` */

DROP TABLE IF EXISTS `orders`;

CREATE TABLE `orders` (
  `id` int(11) NOT NULL auto_increment,
  `order_no` varchar(20) default NULL,
  `user_id` varchar(50) default NULL,
  `store_no` varchar(20) default NULL,
  `totalamount` double default NULL,
  `paymenttype` varchar(20) default NULL,
  `paymentsubtype` varchar(20) default NULL,
  `deliverytype` varchar(20) default NULL,
  `states` int(11) default NULL COMMENT '1：未付款  2：已付款  3：已发货   4：已签收',
  `createtime` datetime default NULL,
  PRIMARY KEY  (`id`),
  KEY `store_orders_idx` (`store_no`),
  KEY `user_orders_idx` (`user_id`),
  CONSTRAINT `store_orders` FOREIGN KEY (`store_no`) REFERENCES `store` (`store_no`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `user_orders` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

