/*Table structure for table `role_manager` */

DROP TABLE IF EXISTS `role_manager`;

CREATE TABLE `role_manager` (
  `id` int(10) NOT NULL auto_increment COMMENT '角色操作人员关联表id',
  `role_id` int(10) default NULL COMMENT '角色id',
  `manager_id` int(10) default NULL COMMENT '操作人员id',
  PRIMARY KEY  (`id`),
  KEY `role_rolemanager_idx` (`role_id`),
  KEY `manager_rolemanager_idx` (`manager_id`),
  CONSTRAINT `manager_rolemanager` FOREIGN KEY (`manager_id`) REFERENCES `manager` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `role_rolemanager` FOREIGN KEY (`role_id`) REFERENCES `role` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
