/*Table structure for table `store_commodity_collection_statistics` */

DROP TABLE IF EXISTS `store_commodity_collection_statistics`;

CREATE TABLE `store_commodity_collection_statistics` (
  `id` int(10) NOT NULL auto_increment COMMENT '统计id',
  `store_no` varchar(20) default NULL COMMENT '门店编号',
  `commodity_no` varchar(20) default NULL COMMENT '商品编号',
  `count` int(10) default '0' COMMENT '收藏次数',
  `type` int(1) default '1' COMMENT '类型，分为一月，三月，6月，12月四挡，分别对应1,2,3,4',
  PRIMARY KEY  (`id`),
  KEY `commodity_scstatistics` (`commodity_no`),
  KEY `store_scstatistics` (`store_no`),
  CONSTRAINT `commodity_scstatistics` FOREIGN KEY (`commodity_no`) REFERENCES `commodity` (`commodity_no`),
  CONSTRAINT `store_scstatistics` FOREIGN KEY (`store_no`) REFERENCES `store` (`store_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

