/*Table structure for table `trolley` */

DROP TABLE IF EXISTS `trolley`;

CREATE TABLE `trolley` (
  `id` int(10) NOT NULL auto_increment COMMENT '购物车id',
  `user_id` varchar(40) default NULL COMMENT '用户id',
  `store_no` varchar(20) default NULL COMMENT '门店编号',
  `commodity_no` varchar(20) default NULL COMMENT '商品编号',
  `amont` int(11) default NULL COMMENT '数量',
  `listprice` double default NULL,
  `totalprice` double default NULL COMMENT '总价',
  `createtime` datetime default NULL COMMENT '创建时间',
  `updatetime` datetime default NULL COMMENT '更新时间',
  PRIMARY KEY  (`id`),
  KEY `user_trolley_idx` (`user_id`),
  KEY `store_trolley_idx` (`store_no`),
  KEY `commodity_trolley_idx` (`commodity_no`),
  CONSTRAINT `commodity_trolley` FOREIGN KEY (`commodity_no`) REFERENCES `commodity` (`commodity_no`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `store_trolley` FOREIGN KEY (`store_no`) REFERENCES `store` (`store_no`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `user_trolley` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

