/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id` varchar(50) NOT NULL COMMENT '用户ID',
  `phone` varchar(20) default NULL COMMENT '手机号',
  `username` varchar(20) default NULL COMMENT '真实姓名',
  `sex` char(2) default NULL COMMENT '性别',
  `mail` varchar(50) default NULL COMMENT '邮箱',
  `portrait` varchar(200) default NULL COMMENT '头像',
  `passwd` varchar(100) default NULL COMMENT '密码',
  `lastlogintime` datetime default NULL COMMENT '最后登录时间',
  `status` int(2) default NULL COMMENT '状态 1.启用 2. 禁用 3.已登录  4 。未登录',
  PRIMARY KEY  (`id`),
  UNIQUE KEY `u_ix_phone` (`phone`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

