/*View structure for view categoryview */

/*!50001 DROP TABLE IF EXISTS `categoryview` */;
/*!50001 DROP VIEW IF EXISTS `categoryview` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `categoryview` AS (select `a`.`FirstID` AS `FirstID`,`a`.`FirstName` AS `FirstName`,`b`.`SecondID` AS `SecondID`,`b`.`SecondName` AS `SecondName`,`c`.`ThirdID` AS `ThirdID`,`c`.`ThirdName` AS `ThirdName` from ((`firstcategoryview` `a` left join `secondcategoryview` `b` on((`b`.`parentid` = `a`.`FirstID`))) left join `thirdcategoryview` `c` on((`c`.`parentid` = `b`.`SecondID`)))) */;

/*View structure for view firstcategoryview */

/*!50001 DROP TABLE IF EXISTS `firstcategoryview` */;
/*!50001 DROP VIEW IF EXISTS `firstcategoryview` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `firstcategoryview` AS (select `category`.`id` AS `FirstID`,`category`.`categoryname` AS `FirstName` from `category` where (`category`.`type` = 1)) */;

